webpackJsonp([0xea51dfad8e9c],{3285:function(e,t){e.exports={data:{markdownRemark:{html:'<ul>\n<li>\n<p><em>Be sure to delimit by category with large comments</em> .</p>\n<ul>\n<li>Make sure to include one line comment in member variables and global variables.</li>\n<li>Always include at least one line comment in the function definition.</li>\n<li>It is preferable to put a standard style comment like <a href="http://ja.wikipedia.org/wiki/Javadoc">javadoc</a> or <a href="http://ja.wikipedia.org/wiki/Doxygen">doxygen</a> at the beginning of the function · member variable. (See comments in the <a href="/tag/flan">FLAN</a> source)</li>\n<li>Include one line comment only when it is hard to understand during processing such as local variables and expressions. (It does not matter if // this is //)</li>\n<li><em>Actively utilize TODO and FIXME</em> .</li>\n<li>TODO has a function that I want to implement, but when setting such a comment at such time as time or technically it is described as "TODO: (what I want to implement)".</li>\n<li>FIXME has confirmed a bug, but if for some reason (temporal or alarming) it is impossible to fix it on its own, set a comment on that part and describe it as "FIXME: (there is such a bug)".</li>\n</ul>\n</li>\n</ul>',frontmatter:{cover:null,date:"2008-04-26T00:00:04+09:00",strDate:"2008/4/25",title:"comment"}}},pathContext:{path:"/en/blog/2008/04/26-コメント/",langKey:"en"}}}});
